    mtc1 $zero, $f6 # set the $f6 register to 0 before summing
    mtc1 $zero, $f7 # set the $f7 register to 0 before summing
loop2:
    l.s $f1, 0($s0) # load in next imag value
    addi $s0, $s0, 4 # increment to next word
    l.s $f2, 0($s1) # load in the next real value
    addi $s1, $s1, 4 # increment to next word
    l.s $f3, 0($s4) # load in the next signal value
    addi $s4, $s4, 4 # increment to the next word
    mul.s $f4, $f3, $f1 # multiply the imag and signal together
    mul.s $f5, $f3, $f2 # multiply the real and signal together
    add.s $f6, $f6, $f4 # add to the accumulator reg
    add.s $f7, $f7, $f5 # add to the accumulator reg
    addi $s3, $s3, -1 # subtract by 1
    bgez $s3, loop2
    mov.s $f12, $f6
    jal printfloat2hex
    li $v0, 4
    la $a0, tab
    syscall
    mov.s $f12, $f7
    jal printfloat2hex
    li $v0, 4
    la $a0, new_line
    syscall
    addi $s2, $s2, -1 # subtract
    bgez $s2, loop1
    j end

printfloat2hex:
    li $v0, 4
    la $a0, hexhead
    syscall
    li $t0, 0xF # mask
    li $t1, 8 # loop counter
    li $t2, 10 # less than check
    mfc1 $t4, $f12 # move float into gpr
printloop:
    move $t5, $t4 # move t4 into t5
    srl $t5, $t5, 28 # shift to the right to normalize
    and $t5, $t5, $t0 # use 0xF to mask although not necessary just want to ensure other bits are cleared
    slt $t6, $t5, $t2 # check if its less than 10
    beq $t6, $zero, hexletter
    addi $t5, $t5, 48
printing:
    move $a0, $t5
    li $v0, 11
    syscall
    sll $t4, $t4, 4 #shift to the left 4 bits to get the next one
    addi $t1, $t1, -1
    bne $t1, $zero, printloop
    jr $ra
hexletter:
    addi $t5, $t5, 87
    j printing


end:
li $v0, 10
syscall
 .end main